import React from 'react';
import Slider from 'react-slick';

const Slideshow = ({ images }) => {
    // Settings for the slider
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 3000,
    };

    return (
        <div>
            <Slider {...settings}>
                {images.map((image, index) => (
                    <div key={index}>
                        <img src={image.picUrl} alt={image.movieName} />
                    </div>
                ))}
            </Slider>
        </div>
    );
};

export default Slideshow;
